import React from "react";
import API from "./utils/API";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    this.getWord(3);
  }

  getWord(difficulty) {
    API.getWords(difficulty)
      .then(function(response) {
        console.log(response.data.lenght);
      })
      .catch(function(error) {
        console.log(error);
      })
      .then(function() {
        // always executed
      });
  }

  render() {
    return <p>Hey</p>;
  }
}

export default App;
